import React from 'react';
import styles from './ClothingCatalog.module.css';

const ClothingCatalog = () => {
  const clothingItems = [
    {
      id: 1,
      name: 'Casual Shirt',
      description: 'Comfortable cotton shirt for everyday wear',
      image: '/assets1/image1.jpg' // We'll update this when you provide the images
    },
    {
      id: 2,
      name: 'Formal Wear',
      description: 'Classic formal attire for special occasions',
      image: '/assets1/image2.jpg' // We'll update this when you provide the images
    }
  ];

  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <button className={styles.backButton} onClick={() => window.history.back()}>
          ‚Üê Back
        </button>
        <h1 className={styles.title}>Clothing Items</h1>
      </header>
      
      <div className={styles.grid}>
        {clothingItems.map(item => (
          <div key={item.id} className={styles.card}>
            <img src={item.image} alt={item.name} className={styles.image} />
            <div className={styles.content}>
              <h3 className={styles.itemTitle}>{item.name}</h3>
              <p className={styles.description}>{item.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ClothingCatalog;
